export async function loadTiltUpdater(engine, refresh = true) {
    await engine.addParticleUpdater("tilt", async (container) => {
        const { TiltUpdater } = await import("./TiltUpdater.js");
        return new TiltUpdater(container);
    }, refresh);
}
